import React from 'react'
import { MDBCol, MDBFormInline, MDBIcon } from "mdbreact";

function Searchbar() {
    return (
        <>
            <MDBIcon icon="search" />
            <input className="form-control form-control ml-3 w-75" type="text" placeholder="Search" aria-label="Search" />
        </>
    )
}

export default Searchbar
